  const data = axios.get("http://localhost:3001/api/users/listclients");
  console.log(data);
  return (
    <>
      <Header />
      <div className="contents_container">
        <table className="allclients">
          <th>Name</th>
          <th>Email</th>
          <th>Mobile</th>
          <th>Client Type</th>
        </table>
      </div>
      ;
    </>
  );
};

export default AllClients;
